class Solution:
    def shortestPalindrome(self, s: str) -> str:
        if s == s[::-1]:
            return s
        pos = {0}
        for i in range(len(s)):
            pos = {0} | {j + 1 for j in pos if s[-i-1] == s[j]}
        return s[max(pos) - len(s):][::-1] + s

sol = Solution()
s = ""
ans = sol.shortestPalindrome(s)
print(ans)